    false,nt"url": null,nt"notes": "Cahaba River National Wildlife Refuge (CRNWR)
    administers approximately 3,414 acres alongthe Cahaba River in Bibb County, Alabama.
    The Refuge was established in 2002 forthe purpose of protecting and managing a unique
    section of the Cahaba River and adjacentforested uplands. The river itself stretches
    for nearly 200 miles through some of Alabamau2019s mostspectacular scenery and is
    considered to be the stateu2019s longest free-flowing stream. The Refugeand surrounding
    area are known to contain one of the greatest concentrations of imperiledspecies
    to be found in North America, 13 of which occur nowhere else in the world. Of these,the
    shoals spiderlily (known locally as the Cahaba lily) has come to symbolize the beauty
    andsignificance of the region. The Refuge contains a fragmented assemblage of managed
    andnaturally occurring uplands, interspersed with a mosaic of bottomland forests,
    streams, andbluffs. Prior to the inception of this project, a detailed inventory
    of natural communities and rareplants did not exist. This report was designed to
    highlight the extent, location, and condition ofCRNWRu2019s natural plant associations
    and rare plant species to furnish land managers with thenecessary information to
    establish and implement appropriate conservation strategies.",nt"license_title":
